window.bookSummaryJSON = "<p>The Western Conference discovers the Reds have stolen their alien-source data on a colonizable planet...and so must rush their plans for an expedition. When their spaceship crashes on Topaz, Travis Fox and his party of modern Apache Indians, reverted to their tribal ancestral memories, find they have already been beaten there. And they must deal with more than Reds - for the Reds have brought along reverted members of Ghenghis Khan's Mongol Horde!</p>"; 
